met Gabrielle Anwar, Justin Louis en Forest Whitaker

Claire Holloway (Gabrielle Anwar) is een licht overwerkte kinderboekenschrijfster die zichzelf een vakantie op het platteland 
gunt. Maar de geplande vakantie wordt een nachtmerrie als zij zich geconfronteerd met een bovennatuurlijke bedreiging ziet die 
zij het hoofd moet bieden als zij het weekend nog wil overleven.
